// Loader.js
import React, { useEffect, useState } from 'react';
import { gsap } from 'gsap';
import './Loader.css'; // Assuming you have a separate CSS file for styles
import Animated from '../Components/Animated';
import Cursor from "../Components/Cursor";
import Popup from '../Components/Popup';

const Loader = () => {
    const [isPopupOpen, setIsPopupOpen] = useState(false);
    useEffect(() => {
        const svg = document.getElementById("svg");
        const tl = gsap.timeline();
        const curve = "M0 502S175 272 500 272s500 230 500 230V0H0Z";
        const flat = "M0 2S175 1 500 1s500 1 500 1V0H0Z";
        tl.from(".loader-wrap-heading h1", {
            delay: 0.2,
            y: 200,
            skewY: 10,
        })
            .to(svg, {
                duration: .3,
                attr: { d: curve },
                ease: "power2.easeIn",
            })
            .to(svg, {
                duration: 0.8,
                attr: { d: flat },
                ease: "power2.easeOut",
            })
            .to(".loader-wrap", {
                y: -1500,
            })
            .to(".loader-wrap", {
                zIndex: -1,
                display: "none",
            })
        tl.from(".img", {
            y: 1500,
        }).to(".img", {
            ease:"power1.out",
            y: 290,
            duration:1
        }
        )
        
    }, []);

    return (
        <>
        <Cursor/>
        <section className="new">
        <div className="yay">
        <p2 className='main'>Sched.snap</p2>
        <p2 className='conta'>Contact</p2>
        </div>
            <div className="loader-wrap">
                <svg viewBox="0 0 1000 1000" preserveAspectRatio="none">
                    <path id="svg" d="M0,1005S175,995,500,995s500,5,500,5V0H0Z"></path>
                </svg>
                <div className="loader-wrap-heading">
                    <span><h1>Loading</h1></span>
                </div>
            </div>
            <div className="container">
                <span>
                    <h1><Animated /></h1>
                    
                </span>
            </div>
            <div className="con">
                    <div className="img">
                        <img src="data:image/png;base64," alt="" width={"220px"} height={"400px"} />
                    </div>
                    <div className="but">
                        <button onClick={() => setIsPopupOpen(true)}>JOIN NOW</button>
                    </div>

            </div>
            </section>
            <Popup isOpen={isPopupOpen} onClose={() => setIsPopupOpen(false)} />
        </>
    );
};

export default Loader;